<?phpnamespace Nemundo\WebLog\Page;use Nemundo\Admin\Com\Pagination\AdminPagination;use Nemundo\Admin\Com\Table\AdminBootstrapTable;use Nemundo\Admin\Com\Table\AdminTable;use Nemundo\Com\TableBuilder\TableHeader;use Nemundo\Com\TableBuilder\TableRow;use Nemundo\Com\Template\AbstractTemplateDocument;use Nemundo\Db\Sql\Order\SortOrder;use Nemundo\Package\Bootstrap\Pagination\BootstrapPagination;use Nemundo\WebLog\Com\ListBox\DomainListBox;use Nemundo\WebLog\Data\UrlLog\UrlLogPaginationReader;use Nemundo\WebLog\Data\UrlLog\UrlLogReader;use Nemundo\WebLog\Template\WebLogTemplate;class UrlLogPage extends WebLogTemplate{    public function getContent()    {        new DomainListBox($this);        $table=new AdminTable($this);        $reader=new UrlLogPaginationReader();        $reader->addOrder($reader->model->visitor,SortOrder::DESCENDING);        $header=new TableHeader($table);        $header->addText($reader->model->pageTitle->label);        $header->addText($reader->model->url->label);        $header->addText($reader->model->visitor->label);        foreach ($reader->getData() as $urlLogRow) {            $row=new TableRow($table);            $row->addText($urlLogRow->pageTitle);            $row->addText($urlLogRow->url);            $row->addText($urlLogRow->visitor);        }        $pagination= new AdminPagination($this);        $pagination->paginationReader=$reader;        return parent::getContent();    }}